description:
This is the version updated to TS2013 standard in February 2013.

Take a trip back to the steam era with this outstanding 'Baby Scot' collection. The locomotives are modelled to a very high level of detail and the eight different models come with different headboards and with and without smoke deflectors.

A set of Just Trains Mk1 coaches is provided to accompany the locomotives, and there is also a selection of enjoyable scenarios included.



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


